import styled from "styled-components";
import Section01 from './Section01'
import Section02 from './Section02'

const MainContainer = styled.main`
    background: #F5F5F5;
    display: flex;
    justify-content: center;
    width: 100%;
    font-family: 'Roboto';
    font-weight: 400;
`

function Main() {
    return (
        <MainContainer>
            <Section01 />
            <Section02 />
        </MainContainer>
    )
};

export default Main;
